import { HttpClient } from "@angular/common/http";
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class GetBreedsService {
  constructor(private http: HttpClient) {}

  public getBreeds() {
    let breeds;
    this.http.get<any>("https://catfact.ninja/breeds").subscribe((res) => {
      breeds = res;
    });
    console.log("ola");

    return breeds;
  }

  public getNextBreeds(oldBreeds: any) {
    let breeds;
    this.http.get<any>(oldBreeds.next_page_url).subscribe((res) => {
      breeds = res;
    });
    return breeds;
  }
  public getPreviousBreeds(oldBreeds: any) {
    let breeds;
    this.http.get<any>(oldBreeds.prev_page_url).subscribe((res) => {
      breeds = res;
    });
    return breeds;
  }
}
